<!DOCTYPE html>

<html>
<head>
    <meta http-equiv="X-UA-Compatible" content="IE=Edge" />
    <title></title>
    <script src="/jsdbg/loader.js" type="text/javascript"></script>
    <style type="text/css">
        code {
            display:block;
            white-space: pre;
            padding-left:2em;
        }

        code::before {
            display:block;
            content:"function(object) \{";
            margin-left:-2em;
        }
        code::after {
            display:block;
            content:"}";
            margin-left:-2em;
        }

        .name::before {
            content:"Name: ";
        }

        .module::before {
            content:"Module: ";
        }

        .type::before {
            content:"Type: ";
        }
    </style>
</head>
<body>
<button>New</button>
<div id="loadedDescriptions"></div>
</body>
</html>
